import React from 'react';
import Header from 'Pages/header.jsx'
import { BrowserRouter as Router,Switch, Route, Link, Redirect } from "react-router-dom";
import Gallery from './Pages/gallery'
import bottleHolders from '../imgs/bottleHolders';
import lunchBoxes from '../imgs/lunchboxes';
import makeupBags from '../imgs/makeupBags';
import pencilCases from '../imgs/pencilcases';
import sets from '../imgs/sets';

const Routes = ()=>{
    <Router>
        <Switch>
            <Header></Header>
            <Route path="/loncheras" exact><Gallery imgDetails={lunchBoxes}></Gallery></Route>
            <Route path="/estucheras" exact><Gallery imgDetails={lunchBoxes}></Gallery></Route>
            <Route path="/cosmetiqueras" exact><Gallery imgDetails={lunchBoxes}></Gallery></Route>
            <Route path="/portabotellas" exact><Gallery imgDetails={lunchBoxes}></Gallery></Route>
            <Redirect to="/loncheras"/>
        </Switch>
    </Router>
}
